import { Component } from '@angular/core';

@Component({
  selector: 'app-padre',
  templateUrl: './padre.component.html',
  styleUrls: ['./padre.component.css']
})

export class PadreComponent {
  nombrePadre:string = 'Pablo';
  apPaternoPadre:string = 'Vargas';
  apMaternoPadre:string = 'Morales';
}
<div>
  <h1>Datos del PADRE</h1>
  <label>Nombre:</label>{{ nombrePadre }}
  <label>Apellido Paterno:</label>{{ apPaternoPadre }}
  <label>Apellido Materno:</label>{{ apMaternoPadre }}
</div>



